import React from 'react'


const fake = true;

export const incidentSocket = {
    ws: null,

    mappings: {},
    reconnectOnClose: false,

    id: '',

    init: function(id) {
        this.id = id
    },

    connect: function() {
        let me = this;

        if (fake) {
            me.startFakeTimer();
            return;
        }

        if (me.ws) {
            me.close();
            return;
        }

        try {
            console.log("Incident Socket Connecting...");
            me.ws = new WebSocket("ws://" + document.location.host + "/incident");
            me.ws.onopen = me.onOpen.bind(me);
            me.ws.onmessage = me.onMessage.bind(me);
            me.ws.onclose = me.onClose.bind(me);
            me.ws.onerror = me.onError.bind(me);
            me.reconnectOnClose = true;
        } catch (e) {
            console.log(e);

            setTimeout(me.connect.bind(me), 3000);
        }
    },

    getId: function() {
        return this.id
    },

    addListener: function(msg, cb) {
        const me = this
        if (!msg || !cb) return
        if (!me.mappings[msg]) me.mappings[msg] = []

        me.mappings[msg].push(cb)
    },

    removeListener: function(msg, cb) {
        const me = this
        if (!msg || !cb) return

        let mappings = me.mappings[msg]
        if (!mappings) return

        const index = mappings.indexOf(cb)
        if (index >= 0) {
            mappings.splice(index, 1)
        }

        return true
    },

    close: function() {
        let me = this;

        if (fake) {
            me.stopFakeTimer();
            return;
        }

        me.reconnectOnClose = false;
        if (!me.ws) return;
        me.ws.close();
        me.ws = null;
    },


    ///////////////////////////////////

    onOpen: function(e) {
        console.log("Incident Socket Opened");
    },

    onMessage: function(e) {
        var me = this;
        console.log(e.data);
        //console.log('New Socket Message');
        try {
            var msgObj = JSON.parse(e.data);
            me.notifyMessage(msgObj);

        } catch (e) {
            console.log(e);
        }
    },

    notifyMessage: function(msgObj) {
        const me = this;
        const mapping = me.mappings[msgObj.type];

        if (!mapping) return
        mapping.forEach(cb => {
            try {
                cb(msgObj)
            } catch (e) {
                console.log(e)
            }
        })
    },

    onClose: function(e) {
        let me = this;
        console.log("Incident Socket Closed");
        me.ws = null;

        if (me.reconnectOnClose) {
            //Retry connection
            setTimeout(me.connect.bind(me), 5000);
        }
    },

    onError: function(e) {
        console.log(e)
    },

    //////////////////////////////////////

    startFakeTimer: function() {
        const me = this

        setTimeout(function(){
            me.pushFakeDashboardData()
        }, 1)
        me.fakeInterval = setInterval(function() {
            me.pushFakeDashboardData()
        }, 1000 * 30)

        console.log('Fake socket timer started.')
    },

    pushFakeDashboardData: function() {
        const me = this

        //////////////////////////////////

        let lines = {}
        fakeMapLines.forEach(item => {
            lines[item.lineId] = {
                "id":				item.id,
                "type":				item.type,

                "fromDeviceid": 	item.fromDevice,
                "fromPoint": 		item.fromPoint,
                "toDeviceid": 		item.toDevice,
                "toPoint": 			item.toPoint,

                "linecolor":		item.linecolor,
                "linewidth":		item.linewidth,
            }
        })

        //////////////////////////////////
        me.notifyMessage({
            type: 'dashboard',
            data: {
                stats: {
                    open: parseInt(Math.random() * 100),
                    today: parseInt(Math.random() * 30),
                    attackers: parseInt(Math.random() * 20),
                    month: parseInt(Math.random() * 300),
                },
                mapDevices: fakeMapDevices,
                mapLines: lines,
                incidents: fakeIncidents,
            }
        })
    },

    stopFakeTimer: function () {
        const me = this
        clearInterval(me.fakeInterval)

        console.log('Fake socket timer stopped.')
    },

    ///////////////////////////////////
}


